package neutron.capture.persistencia;

import com.sun.jersey.api.client.Client;
import com.sun.jersey.api.client.ClientResponse;
import com.sun.jersey.api.client.UniformInterfaceException;
import com.sun.jersey.api.client.WebResource;
import com.sun.jersey.core.util.Base64;
import java.io.BufferedReader;
import java.io.File;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.OutputStreamWriter;
import java.net.HttpURLConnection;
import java.net.MalformedURLException;
import java.net.URL;
import java.nio.file.Files;
import java.util.logging.Level;
import java.util.logging.Logger;
import javax.ws.rs.core.MediaType;
import org.codehaus.jettison.json.JSONException;
import org.codehaus.jettison.json.JSONObject;

/**
 * Jersey REST client generated for REST resource:_1 [rest/search/query=p53]<br>
 * USAGE:
 * <pre>
 *        Proxy client = new Proxy();
 *        Object response = client.XXX(...);
 *        // do whatever with response
 *        client.close();
 * </pre>
 *
 * @author Marcos Arruda; Gustavo Balad√£o; Jonatha Daguerre
 */
public class Proxy {

    private WebResource webResource;
    private Client client;
    private static final String BASE_URI = "http://192.168.0.205/WcfContent/WcfContent.svc/REST";
    public boolean webSericeOnLine;

    public Proxy() {
        webSericeOnLine = false;
        com.sun.jersey.api.client.config.ClientConfig config = new com.sun.jersey.api.client.config.DefaultClientConfig();
        client = Client.create(config);
        webResource = client.resource(BASE_URI).path("");
    }

    /**
     * @param q representa a query do Rest
     * @return retorna uma String com resultado
     */
    public String getResultGet(String q) throws UniformInterfaceException {
        ClientResponse clientResponse = webResource.path(java.text.MessageFormat.format("/{0}", new Object[]{q})).get(ClientResponse.class);
        return clientResponse.getEntity(String.class);
    }

    public String getResultTeste() {
        StringBuilder sb = new StringBuilder();

        String http = "http://192.168.0.205/WcfContent/WcfContent.svc/REST/jsonRecebePagina";

        HttpURLConnection urlConnection = null;
        try {
            URL url = new URL(http);
            urlConnection = (HttpURLConnection) url.openConnection();
            urlConnection.setDoOutput(true);
            urlConnection.setRequestMethod("POST");
            urlConnection.setUseCaches(false);
            urlConnection.setConnectTimeout(10000);
            urlConnection.setReadTimeout(10000);
            urlConnection.setRequestProperty("Content-Type", "application/json");

            urlConnection.setRequestProperty("Host", "android.schoolportal.gr");
            urlConnection.connect();

            //Create JSONObject here
            JSONObject jsonParam = new JSONObject();
            jsonParam.put("ChaveAcesso", "85d520fe-4570-4109-9f20-b835cf92aefd");
            jsonParam.put("TipoDocumental", "1");
            jsonParam.put("IdDoc", "9");
            jsonParam.put("NumeroPagina", "1");
            jsonParam.put("Extensao", ".TIF");
            String b64 = "";
            b64 += "";
            jsonParam.put("Base64File", b64);
            OutputStreamWriter out = new OutputStreamWriter(urlConnection.getOutputStream());
            out.write(jsonParam.toString());
            out.close();

            int HttpResult = urlConnection.getResponseCode();
            if (HttpResult == HttpURLConnection.HTTP_OK) {
                BufferedReader br = new BufferedReader(new InputStreamReader(
                        urlConnection.getInputStream(), "utf-8"));
                String line = null;
                while ((line = br.readLine()) != null) {
                    sb.append(line + "\n");
                }
                br.close();

                return  sb.toString();

            } else {
                System.out.println(urlConnection.getResponseMessage());
            }
        } catch (MalformedURLException e) {
            e.printStackTrace();
        } catch (IOException e) {

            e.printStackTrace();
        } catch (JSONException e) {
            // TODO Auto-generated catch block
            e.printStackTrace();
        } finally {
            if (urlConnection != null) {
                urlConnection.disconnect();
            }
        }
        return "";
    }

    public String getResultPut(String q, String FileName, String ChaveAcesso) throws UniformInterfaceException {
        try {
            File file_upload = new File(FileName);

            JSONObject gson = new JSONObject();
            gson.put("ChaveAcesso", ChaveAcesso);            
            gson.put("TipoDocumental", "1");
            gson.put("IdDoc", "9");
            gson.put("NumeroPagina", "1");
            gson.put("Extensao", ".TIF");
            String b64 = convertFileToString(file_upload);
            gson.put("Base64File", b64);

            //ClientResponse clientResponse = webResource.path(java.text.MessageFormat.format("/{0}", new Object[]{q})).post( ClientResponse.class,gson);
            q = java.text.MessageFormat.format("/{0}", new Object[]{q});

            ClientResponse clientResponse = webResource.path(q).accept(MediaType.APPLICATION_JSON).post(ClientResponse.class, gson);
            //return "Status: " + clientResponse.getStatus();
            return clientResponse.getEntity(String.class);
        } catch (Exception ex) {
            Logger.getLogger(Proxy.class.getName()).log(Level.SEVERE, null, ex);
            return ex.toString();
        }

    }

    private String convertFileToString(File file) throws IOException {
        byte[] bytes = Files.readAllBytes(file.toPath());
        return new String(Base64.encode(bytes));
    }

    public void close() {
        client.destroy();
    }
}
